import React from 'react';
import Link from './Link';

const Header = () => {
  return (
    <div className="ui secondary pointing menu">
      <Link href="/" className="item">
        Accordion
      </Link>
      <Link href="/videos" className="item">
        Videos
      </Link>
      <Link href="/dropdown" className="item">
        Dropdown
      </Link>
    </div>
  );
};

export default Header;
